import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeIndex, setActiveIndex] = useState(0);

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveIndex(prev => (prev + 1) % 6);
    }, 2000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
      background: 'linear-gradient(45deg, #0A0F2C, #1A1F3C)',
      borderRadius: '30px',
      overflow: 'hidden',
    }}>
      {/* Background Grid */}
      <div style={{
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        backgroundImage: `
          linear-gradient(rgba(147, 197, 253, 0.1) 1px, transparent 1px),
          linear-gradient(90deg, rgba(147, 197, 253, 0.1) 1px, transparent 1px)
        `,
        backgroundSize: '20px 20px',
        opacity: 0.3,
      }} />

      {/* Main Hexagon Container */}
      <div style={{
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: '400px',
        height: '400px',
      }}>
        {/* Hexagonal Elements */}
        {[0, 1, 2, 3, 4, 5].map((index) => {
          const angle = (index * 60) * (Math.PI / 180);
          const radius = 150;
          const x = Math.cos(angle) * radius;
          const y = Math.sin(angle) * radius;

          return (
            <div
              key={index}
              style={{
                position: 'absolute',
                top: '50%',
                left: '50%',
                transform: `translate(${x}px, ${y}px)`,
                width: '100px',
                height: '115px',
                clipPath: 'polygon(50% 0%, 100% 25%, 100% 75%, 50% 100%, 0% 75%, 0% 25%)',
                background: index === activeIndex ?
                  'linear-gradient(45deg, rgba(147, 197, 253, 0.3), rgba(96, 165, 250, 0.3))' :
                  'rgba(147, 197, 253, 0.1)',
                border: '1px solid rgba(147, 197, 253, 0.2)',
                transition: 'all 0.3s ease',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                flexDirection: 'column',
                padding: '10px',
                backdropFilter: 'blur(5px)',
              }}
            >
              <div style={{
                color: '#FFFFFF',
                fontSize: '12px',
                textAlign: 'center',
                opacity: index === activeIndex ? 1 : 0.7,
              }}>
                {getHexagonContent(index).title}
              </div>
              <div style={{
                marginTop: '5px',
                fontSize: '24px',
                color: '#93C5FD',
                opacity: index === activeIndex ? 1 : 0.5,
              }}>
                {getHexagonContent(index).icon}
              </div>
            </div>
          );
        })}

        {/* Center Circle */}
        <div style={{
          position: 'absolute',
          top: '50%',
          left: '50%',
          transform: 'translate(-50%, -50%)',
          width: '150px',
          height: '150px',
          borderRadius: '50%',
          background: 'linear-gradient(45deg, rgba(147, 197, 253, 0.2), rgba(96, 165, 250, 0.2))',
          border: '2px solid rgba(147, 197, 253, 0.3)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          flexDirection: 'column',
          backdropFilter: 'blur(10px)',
        }}>
          <div style={{
            fontSize: '40px',
            color: '#93C5FD',
            marginBottom: '5px',
          }}>
            AI
          </div>
          <div style={{
            color: '#FFFFFF',
            fontSize: '14px',
            opacity: 0.8,
          }}>
            Core
          </div>
        </div>

        {/* Connection Lines */}
        <svg style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          pointerEvents: 'none',
        }}>
          {[0, 1, 2, 3, 4, 5].map((index) => {
            const angle = (index * 60) * (Math.PI / 180);
            const innerRadius = 75;
            const outerRadius = 150;
            const x1 = 200 + Math.cos(angle) * innerRadius;
            const y1 = 200 + Math.sin(angle) * innerRadius;
            const x2 = 200 + Math.cos(angle) * outerRadius;
            const y2 = 200 + Math.sin(angle) * outerRadius;

            return (
              <line
                key={index}
                x1={x1}
                y1={y1}
                x2={x2}
                y2={y2}
                stroke="#93C5FD"
                strokeWidth={index === activeIndex ? "2" : "1"}
                strokeOpacity={index === activeIndex ? "0.5" : "0.2"}
                strokeDasharray="4"
              >
                <animate
                  attributeName="strokeDashoffset"
                  values="0;8"
                  dur="1s"
                  repeatCount="indefinite"
                />
              </line>
            );
          })}
        </svg>
      </div>

      {/* Floating Particles */}
      {Array.from({ length: 20 }).map((_, i) => (
        <div
          key={`particle-${i}`}
          style={{
            position: 'absolute',
            width: '4px',
            height: '4px',
            backgroundColor: '#93C5FD',
            borderRadius: '50%',
            left: `${Math.random() * 100}%`,
            top: `${Math.random() * 100}%`,
            opacity: 0.5,
            animation: `
              floatParticle ${5 + Math.random() * 5}s infinite linear ${Math.random() * 5}s
            `,
          }}
        />
      ))}
    </div>
  );
}

function getHexagonContent(index) {
  const content = [
    { title: 'Natural Language', icon: 'üí≠' },
    { title: 'Deep Learning', icon: 'üß†' },
    { title: 'Pattern Recognition', icon: 'üîç' },
    { title: 'Data Analysis', icon: 'üìä' },
    { title: 'Knowledge Base', icon: 'üìö' },
    { title: 'Neural Networks', icon: 'üîÑ' },
  ];
  return content[index];
}

export default AIVisual;
